import React, { useState, useEffect } from "react";
import { Box, Grid, Typography, Paper } from "@mui/material";
import axios from "axios";
import Cookies from "js-cookie";

const DisplayDescriptions = (props) => {
  const [desc, setDesc] = useState();
  const apiUrl = "http://127.0.0.1:8000/descriptions/";
  const token = Cookies.get("jwtToken");

  const params = {
    video_id: props.id,
    jwt: token,
  };
  useEffect(() => {
    axios
      .get(apiUrl, {
        params: params,
      })
      .then((response) => {
        setDesc(
          response.data.descriptions.map((item) => {
            return JSON.parse(item);
          })
        );
        console.log("This is what I am recieving in display description", desc);
      })
      .catch((err) => {
        console.log("Not recieving data", err);
      });
  }, []);


  return (
    <Box
      p={2}
      sx={{
        backgroundColor: "#1D5B79",
        borderRadius: "5px",
        marginBottom: "32px",
      }}
    >
      <Box p={1.5} borderRadius="5px" sx={{ backgroundColor: "white" }}>
        <Typography variant="body1" sx={{ color: "#1D5B79" }}>
          {console.log("here is the value", desc)}I am just displaying some
          random information here for now
        </Typography>
      </Box>
    </Box>
  );
};

export default DisplayDescriptions;
